import React, { Component } from "react";
import CardNota from "./CardNota";

export default class ListaDeNotas extends Component {

    render() {
        return (
            <ul>
                <li>
                    <CardNota />

                </li>

                <li>
                    <section>
                        <header>
                            <h3>Titulo</h3>
                        </header>
                        <p>Escreva sua nota</p>
                    </section>
                </li>

                <li>
                    <section>
                        <header>
                            <h3>Titulo</h3>
                        </header>
                        <p>Escreva sua nota</p>
                    </section>
                </li>

            </ul>
        );
    }

}
